import React from "react";
import "./Item.css";
import { Button } from "@mui/material";

const Item = (props) => {
  return (
    <div className="container">
      <div className="item-div">
        <h3 className={`item-h3`}>{props.item}</h3>
        <div className="btn-div">
          <Button
            className="btn btn-success"
            variant="contained"
            color="success"
            size="small"
          >
            Done
          </Button>
          <Button
            className="btn btn-error"
            variant="outlined"
            color="error"
            size="small"
          >
            Delete
          </Button>
        </div>
      </div>
    </div>
  );
};

export default Item;
